import React from 'react';

interface SeedingSelectProps {
  options: [],
  handleChange: () => {},
  selected: '',
}

const SeedingSelect = (props) => {
  const {options, handleChange, selected} = this.props;
  return (
    <div>
      <select value={selected} onChange={handleChange}>
        {options.map(option => (
          <option key={option.value} value={option.value}>
            {option.text}
          </option>
        ))}
      </select>
    </div>
  );
}
 
export default SeedingSelect;
